// src/App.js (FULL CODE - Updated with Home component)

import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// Import Components and Pages
import Header from "./components/Header";
import PrivateRoute from "./components/PrivateRoute";
import Register from "./pages/Register";
import DonorProfile from "./pages/DonorProfile";
import Login from "./pages/Login";
import SearchDonors from "./pages/SearchDonors";
import Home from "./pages/Home"; // <-- NEW IMPORT

const App = () => {
  return (
    <Router>
      <Header />

      {/* Removed the inline style for padding, keeping content simple */}
      <div>
        <Routes>
          {/* Default/Home Route - Now points to the new component */}
          <Route path="/" element={<Home />} />

          <Route path="/register" element={<Register />} />
          <Route path="/login" element={<Login />} />
          <Route path="/search" element={<SearchDonors />} />

          {/* PROTECTED ROUTE */}
          <Route
            path="/profile"
            element={<PrivateRoute element={DonorProfile} />}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
